import React from 'react'
import '../estilos/Fuerza.css'
import armada from '../ARMADA.png'
import ejercito from '../EjercitoEB.png'
//import emblema from '../Emblema_Policia.png'
import fuerza from '../FuerzaAereaFAB.png'

function Fuerza() {
  return (
    <div className='contenedor'>
        <div className='contenedor-uno'>
            <img src={armada} alt="arm" className='imag1'/>
            <img src={ejercito} alt="ejer" className='imag2'/>
        </div>
        <div className='contenedor-dos'>
            {/* <img src={emblema} alt="emb" className='imag3'/> */}
            <img src={fuerza} alt="fuer" className='imag4'/>
        </div>
    </div>
  )
}

export { Fuerza }
